import { combineReducers } from "redux";

import itemsReducer from "./itemsReducer";
import cartReducers from "./cartReducers";
import sessionReducers from "./sessionReducers";
import orderCartReducers from "./orderCartReducers";
import shippingAndCardReducers from "./shippingAndCardReducers";

const rootReducer = combineReducers({
  itemsReducers: itemsReducer,
  cartReducers: cartReducers,
  sessionReducers: sessionReducers,
  orderCartReducers: orderCartReducers,
  shippingAndCardReducers: shippingAndCardReducers,
});

export default rootReducer;
